import React from 'react';

const Body = () => {
    const background = `background: linear-gradient(to bottom, rgba(255,255,255,0.15) 0%, rgba(0,0,0,0.15) 100%), radial-gradient(at top center, rgba(255,255,255,0.40) 0%, rgba(0,0,0,0.40) 120%) #989898; 
    background-blend-mode: multiply,multiply;`
    return (
        <div style={{background: `${background}`}} className="ui segment">
            <h1 className="ui center aligned header">Dash Chat</h1>
            <h2 className="ui center aligned header"> React Communications App</h2>
        </div>
    )
};

export default Body;
